function run(ticket) {
    ticket = JSON.parse(ticket);
    let tags = { semInteracao: false, clienteDuvida: false, testeTake: false }
    if(ticket.tags){
        for(var i = 0; i < ticket.tags.length; i++){
            if(ticket.tags[i] === "#sem interação") {
                tags.semInteracao = true;
            }
            else if(ticket.tags[i] === "#cliente em duvida") {
                tags.clienteDuvida = true;
            }
            else if(ticket.tags[i] === "#teste da take") {
                tags.testeTake = true;
            }
        }
    }
    return tags;
}

